import React from 'react';
import { StyleSheet, Text, View} from 'react-native';


export default function MainScreen(props){
    return(
        <View style={styles.container}><Text style={styles.title}>Pay Your Expenses</Text></View>
    );
}


const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    title:{
        fontSize:20,
        color:'red',
        fontWeight:'bold'
    }
  });
